import React from "react";
import styled from "styled-components";
const Card = ({ data, deleteCard }) => {
  //   console.log(data);
  const { item, Cals } = data;
  //   console.log(item, Cals);
  // const handleClick =
  return (
    <StyledCard>
      <h1>{item}</h1>
      <h3>you have consumed {Cals} cals today</h3>
      <button
        onClick={() => {
          deleteCard(item);
        }}
      >
        Remove
      </button>
    </StyledCard>
  );
};

export default Card;

const StyledCard = styled.div``;
